// 現在のページを取得する。
var page = Forguncy.Page;
// 現在のページでatesakiという名前のセルを取得する。
var atesakicell = page.getCell("atesaki222");
// getValueメソッドでatesakiセルの値を取得する。
var atesakicellValue = atesakicell.getValue();
// 宛先を配列にする
var atesakiitem = atesakicellValue.split(',');
//　配列に含まれる重複を削除
var atesakiitem1 = new Set(atesakiitem);



// 現在のページでnippouIDセルを取得する。
var nidcell = page.getCell("NIPPOU");
// getValueメソッドでmidセルの値を取得する。
var nidcellValue = nidcell.getValue();
// 現在のページでユーザーセルを取得する。
var toukousyacell = page.getCell("ユーザー");
// getValueメソッドでuserセルの値を取得する。
var toukousyacellValue = toukousyacell.getValue();


atesaki = [];


// atesakiitem1の配列の数を繰り返して、オブジェクトを作成
for ( var ate of atesakiitem1) { 
 atesaki.push(
	{
		宛先ユーザー: ate,
		日報chatID: nidcellValue,
		宛先メンバー: true,
		差出人: toukousyacellValue,
		既読状態: "false",
		コメント既読状態: "true",
		区分: "1"
	});
}



Forguncy.Page.getCell("atesaki_obj3").setValue(atesaki);

